      des: "ddewwwwws",
      img: "img1",
    },
    {
      links: ["www.googlr.com", "www.mako.co.il"],
      title: "fvdxxxxxxs",
      des: "desssss",
      img: "img2",
    },
  ];

  return (
    <div>
      <Card
        img={data[0].img}
        title={data[0].title}
        des={data[0].des}
        links={data[0].links}
      />
